  false,\n\t\"url\": null,\n\t\"notes\": \"The Necedah NWR Safety Plan discusses policies
  for the safety of the station employees, volunteers, and public. This plan seeks
  to identify and correct unsafe conditions and preclude unsafe acts through education
  and on-the-job training. Contained in this plan are Refuge safety objectives, an
  emergency contact listing, details on equipment and training, and a list of general
  hazardous conditions.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
